import React from 'react';
import ReactDOM from 'react-dom';
//通过combinereducers把多个rendcer进行合并
import './App.css';
import 'element-theme-default';
import axios from 'axios';
import Addto from "./top/Addto/Addto";
import addto from "./top/Addto/top-add/index";
import server from "./top/input/server/server"
import remind from "./top/Remind/top-remind/index";
import my from  "./bottom/My/Login/index";
import video from "./bottom/Videoschool/video/index";
import bakings from "./bottom/Bakingcircle/bakings/index";
import home from "./bottom/Homepage/home/index";
import soosnovice from "./so-so/Noviceguide/soso-novice/index"
import sosobaking from "./so-so/BakingEncyclopedia/soso-baking/index";
import sosodail from "./so-so/Dailysignin/soso-dail/index";
import sosocook from "./so-so/Cookbook/soso-cook/index";
import midschool from "./middle/Schoolselection/mid-school/index"
import {HashRouter as Router ,Route,Switch} from "react-router-dom";
import * as serviceWorker from './serviceWorker';
React.Component.prototype.$axios = axios ;
axios.interceptors.request.use((config)=>{
    config.url="/api"+config.url;
    return config;
})
axios.interceptors.response.use(({data})=>{
    return data
})
ReactDOM.render(
            <Router>
                <Switch>
                    <Route exact component={addto} path={'/Addto'}></Route>
                    <Route component={server} path={"/server"}></Route>
                    <Route exact component={remind} path={'/remind'}></Route>
                    <Route component={soosnovice} path={'/soosnovice'}></Route>
                    <Route component={sosobaking} path={'/sosobaking'}></Route>
                    <Route component={sosodail} path={'/sosodail'}></Route>
                    <Route component={sosocook} path={'/sosocook'}></Route>
                    <Route component={midschool} path={'/midschool'}></Route>
                    <Route  component={my} path={'/my'}></Route>
                    <Route component={video} path={'/video'}></Route>
                    <Route component={bakings} path={'/bakings'}></Route>
                    <Route component={home} path={'/home'}></Route>
                     <Addto/>
                </Switch>
            </Router>

,
  document.getElementById('root')
);
// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
